package main

import (
	"fmt"
	"pintu/test2/first_occurance"
	"pintu/test2/smallest_lexicographical_order"
)

const (
	s = ""
)

func main() {
	firstOccurance := first_occurance.FirstOccurance(s)
	fmt.Printf("%s -> the first occurence from left to right, the last in lexicographical order\n", firstOccurance)

	smallestLexicographicalOrder := smallest_lexicographical_order.SmallestLexicographicalOrder(firstOccurance)
	fmt.Printf("%s -> smallest lexicographical order", smallestLexicographicalOrder)
}
